import './App.css';

function App() {
  const date = new Date();
  const formatter = new Intl.DateTimeFormat('de-DE',
  { weekday: 'long', year: 'numeric', month: 'long', day: 'numeric' });
  const dateString = formatter.format(date);
  return (
    <div className="App">
      <h1>{dateString}</h1>
    </div>
  );
}

export default App;
